PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE `announcements` (
	`id` text PRIMARY KEY NOT NULL,
	`school_id` text NOT NULL,
	`title` text NOT NULL,
	`content` text NOT NULL,
	`priority` text DEFAULT 'medium' NOT NULL,
	`type` text DEFAULT 'general' NOT NULL,
	`target_audience` text DEFAULT 'all' NOT NULL,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `assignments` (
	`id` text PRIMARY KEY NOT NULL,
	`title` text NOT NULL,
	`description` text,
	`due_date` text NOT NULL,
	`file_name` text NOT NULL,
	`class_id` text,
	`school_id` text,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`class_id`) REFERENCES `classes`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `classes` (
	`id` text PRIMARY KEY NOT NULL,
	`name` text NOT NULL,
	`school_id` text,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `grades` (
	`id` text PRIMARY KEY NOT NULL,
	`student_id` text NOT NULL,
	`subject_id` text NOT NULL,
	`grade_type` text DEFAULT 'assignment' NOT NULL,
	`max_score` integer DEFAULT 100 NOT NULL,
	`actual_score` integer NOT NULL,
	`graded_by` text NOT NULL,
	`term` text DEFAULT 'first' NOT NULL,
	`academic_year` text NOT NULL,
	`notes` text,
	`school_id` text NOT NULL,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`student_id`) REFERENCES `students`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`subject_id`) REFERENCES `subjects`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`graded_by`) REFERENCES `staff`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `payments` (
	`id` text PRIMARY KEY NOT NULL,
	`student_id` text NOT NULL,
	`received_by` text NOT NULL,
	`school_id` text NOT NULL,
	`amount` integer NOT NULL,
	`payment_type` text DEFAULT 'tuition' NOT NULL,
	`payment_method` text DEFAULT 'cash' NOT NULL,
	`term` text,
	`academic_year` text,
	`payment_date` text DEFAULT CURRENT_TIMESTAMP,
	`notes` text,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`student_id`) REFERENCES `students`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`received_by`) REFERENCES `staff`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `plans` (
	`id` text PRIMARY KEY NOT NULL,
	`name` text NOT NULL,
	`description` text,
	`duration_days` integer DEFAULT 30 NOT NULL,
	`price` integer DEFAULT 0 NOT NULL,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text
);
CREATE TABLE `schools` (
	`id` text PRIMARY KEY NOT NULL,
	`name` text NOT NULL,
	`address` text,
	`license` text,
	`city` text DEFAULT 'Freetown',
	`logo_url` text,
	`contact` text,
	`email` text,
	`website` text,
	`founded_on` text,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text
);
CREATE TABLE `staff` (
	`id` text PRIMARY KEY NOT NULL,
	`staff_id` text NOT NULL,
	`first_name` text NOT NULL,
	`middle_name` text,
	`last_name` text NOT NULL,
	`email` text,
	`password` text NOT NULL,
	`avatar_url` text,
	`contact` text NOT NULL,
	`address` text NOT NULL,
	`status` text DEFAULT 'active',
	`employment_type` text DEFAULT 'full-time' NOT NULL,
	`notes` text,
	`school_id` text NOT NULL,
	`role` text DEFAULT 'staff' NOT NULL,
	`permissions` text DEFAULT 'students:view,students:create,students:edit,students:delete,staff:view,subjects:view,classes:view',
	`employed_date` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `students` (
	`id` text PRIMARY KEY NOT NULL,
	`admission_number` text NOT NULL,
	`first_name` text NOT NULL,
	`middle_name` text,
	`last_name` text NOT NULL,
	`email` text,
	`gender` text NOT NULL,
	`phone_number` text,
	`address` text,
	`date_of_birth` text,
	`avatar_url` text,
	`status` text DEFAULT 'enrolled' NOT NULL,
	`school_id` text,
	`class_id` text,
	`admission_date` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`class_id`) REFERENCES `classes`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `subjects` (
	`id` text PRIMARY KEY NOT NULL,
	`name` text NOT NULL,
	`code` text,
	`school_id` text,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `subscriptions` (
	`id` text PRIMARY KEY NOT NULL,
	`school_id` text NOT NULL,
	`plan_id` text NOT NULL,
	`start_date` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`end_date` text,
	`status` text DEFAULT 'active' NOT NULL,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`plan_id`) REFERENCES `plans`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE TABLE `transactions` (
	`id` text PRIMARY KEY NOT NULL,
	`school_id` text NOT NULL,
	`subscription_id` text NOT NULL,
	`amount` integer NOT NULL,
	`transaction_type` text DEFAULT 'subscription' NOT NULL,
	`payment_method` text DEFAULT 'mobile_money' NOT NULL,
	`description` text,
	`created_at` text DEFAULT CURRENT_TIMESTAMP NOT NULL,
	`updated_at` text,
	FOREIGN KEY (`school_id`) REFERENCES `schools`(`id`) ON UPDATE no action ON DELETE cascade,
	FOREIGN KEY (`subscription_id`) REFERENCES `subscriptions`(`id`) ON UPDATE no action ON DELETE cascade
);
CREATE UNIQUE INDEX `plans_name_unique` ON `plans` (`name`);
CREATE UNIQUE INDEX `schools_license_unique` ON `schools` (`license`);
CREATE UNIQUE INDEX `schools_contact_unique` ON `schools` (`contact`);
CREATE UNIQUE INDEX `schools_email_unique` ON `schools` (`email`);
CREATE UNIQUE INDEX `schools_website_unique` ON `schools` (`website`);
CREATE UNIQUE INDEX `staff_staff_id_unique` ON `staff` (`staff_id`);
CREATE UNIQUE INDEX `students_admission_number_unique` ON `students` (`admission_number`);
COMMIT;
